import { AppBar, Toolbar } from '@material-ui/core'
import React from 'react'

interface IProps{
    title: string
}

const SubHeaderBar: React.FC<IProps> = (props) =>{

    const {title} = props

    return(
        <AppBar position='sticky' color='default'>
            <Toolbar>
            {title}
            </Toolbar>
        </AppBar>
    )
}

export default SubHeaderBar
